import React, { useState } from "react";
import './styles/App.css'

function App() {
  const [likes, setLikes] = useState(0)

  function Plus() {
    setLikes(likes + 1)
  }

  function Minus() {
    setLikes(likes - 1)
  }

  return (
    <div className="App">
      <h1>{likes}</h1>
      <button onClick={(Minus)}>Minus</button>
      <button onClick={(Plus)}>Plus</button>
    </div>
  );
}

export default App;
